As a part of the 2021 edition a migration lint, rust_2021_incompatible_closure_captures, has been added in order to aid in automatic migration of Rust 2018 codebases to Rust 2021. In order to have rustfix migrate your code to be Rust 2021 Edition compatible, run: cargo fix --edition Below is an examination of how to manually migrate code to use closure captures that are compatible with Rust 2021 should the automatic migration fail or you would like to better understand how the migration works. Changing the variables captured by a closure can cause programs to change behavior or to stop compiling in two cases: changes to drop order, or when destructors run ( details ); changes to which traits a closure implements ( details ). Whenever any of the scenarios below are detected, cargo fix will insert a "dummy let" into your closure to force it to capture the entire variable: let x = (vec![22], vec![23]);
let c = move || { // "Dummy let" that forces `x` to be captured in its entirety let _ = &x; // Otherwise, only `x.0` would be captured here println!("{:?}", x.0);
}; This is a conservative analysis: in many cases, these dummy lets can be safely removed and your program will work fine.

